import React from "react";
import { Col } from "react-bootstrap";

export interface Props {
  name: string;
  url: string;
  language: string;
}

const GitProject: React.SFC<Props> = ({ items }) => {
  return (
    <Col>
      {props.name}
      {props.language}
      {props.url}
    </Col>
  );
};

export default GitProject;
